import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

// ═══════════════════════════════════════════════════════════════════
// ✅ VERSÃO FINAL - TEXTO CENTRALIZADO - LOGO À DIREITA
// ═══════════════════════════════════════════════════════════════════

interface QuoteItem {
  quantity: number;
  description: string;
  unitPrice: number;
  total: number;
}

interface QuoteData {
  quoteNumber: string;
  date: string;
  time: string;
  seller: string;
  customerName: string;
  customerDoc: string;
  customerAddress: string;
  customerPhone: string;
  items: QuoteItem[];
  discountType: 'percent' | 'value'; // ✅ ADICIONADO
  discountAmount: number;
  paymentMethod: string;
  observations: string;
  customerSignature: string;
}

export const generateQuotePDF = (data: QuoteData) => {
  const doc = new jsPDF();
  
  const pageWidth = doc.internal.pageSize.getWidth();
  const pageHeight = doc.internal.pageSize.getHeight();
  let yPosition = 10;

  // ══════════════════════════════════════════════════════════════════
  // ✅ CABEÇALHO BRANCO
  // ══════════════════════════════════════════════════════════════════
  doc.setFillColor(255, 255, 255);
  doc.rect(0, 0, pageWidth, 32, 'F');
  
  // Borda inferior cinza
  doc.setDrawColor(200, 200, 200);
  doc.setLineWidth(0.5);
  doc.line(0, 32, pageWidth, 32);
  
  // ══════════════════════════════════════════════════════════════════
  // ✅ LOGO À DIREITA (40x16mm)
  // ══════════════════════════════════════════════════════════════════
  try {
    const LOGO = 'data:image/png;base64,';
    const logoWidth = 40;
    const logoHeight = 16;
    const logoX = pageWidth - logoWidth - 10; // 10mm da margem direita
    const logoY = 8; // Centralizado verticalmente
    
    doc.addImage(LOGO, 'PNG', logoX, logoY, logoWidth, logoHeight);
  } catch (e) {
    console.warn('Erro ao adicionar logo:', e);
  }
  
  // ══════════════════════════════════════════════════════════════════
  // ✅ TEXTO CENTRALIZADO
  // ══════════════════════════════════════════════════════════════════
  doc.setFontSize(20);
  doc.setFont('helvetica', 'bold');
  doc.setTextColor(0, 0, 0);
  doc.text('ELÉTRICA PADRÃO', pageWidth / 2, 10, { align: 'center' });
  
  doc.setFontSize(8);
  doc.setFont('helvetica', 'normal');
  doc.text('AV. PERIMETRAL, 2095 - CENTRO - POUSO ALEGRE-MG', pageWidth / 2, 17, { align: 'center' });
  
  // Telefones centralizados
  doc.setTextColor(0, 0, 0);
  const telText = 'TEL: 35-3421 3654 / 4102 0262 / ';
  const whatsText = 'WhatsApp 35-98895 7050';
  const totalWidth = doc.getTextWidth(telText) + doc.getTextWidth(whatsText);
  const startX = (pageWidth - totalWidth) / 2;
  
  doc.text(telText, startX, 24);
  
  // WhatsApp em VERDE
  doc.setTextColor(37, 211, 102);
  doc.setFont('helvetica', 'bold');
  doc.text(whatsText, startX + doc.getTextWidth(telText), 24);
  
  doc.setTextColor(0, 0, 0);
  doc.setFont('helvetica', 'normal');

  yPosition = 37;

  // Linha de informações
  doc.setFillColor(245, 245, 245);
  doc.rect(0, yPosition, pageWidth, 8, 'F');
  
  doc.setFontSize(8);
  doc.setFont('helvetica', 'bold');
  doc.setTextColor(0, 0, 0);
  
  doc.text(`ORÇAMENTO:`, 10, yPosition + 5);
  doc.setFont('helvetica', 'normal');
  doc.text(data.quoteNumber, 33, yPosition + 5);
  
  doc.setFont('helvetica', 'bold');
  doc.text(`DATA DE EMISSÃO:`, pageWidth / 2 - 20, yPosition + 5);
  doc.setFont('helvetica', 'normal');
  doc.text(`${data.date} ${data.time}`, pageWidth / 2 + 10, yPosition + 5);
  
  doc.setFont('helvetica', 'bold');
  doc.text(`VENDEDOR:`, pageWidth - 45, yPosition + 5);
  doc.setFont('helvetica', 'normal');
  doc.text(data.seller, pageWidth - 25, yPosition + 5);
  
  yPosition += 12;

  // DADOS DO CLIENTE
  doc.setFillColor(33, 150, 243);
  doc.rect(10, yPosition, pageWidth - 20, 8, 'F');
  
  doc.setFontSize(11);
  doc.setFont('helvetica', 'bold');
  doc.setTextColor(255, 255, 255);
  doc.text('DADOS DO CLIENTE', 15, yPosition + 5.5);
  
  yPosition += 12;
  
  doc.setFontSize(9);
  doc.setFont('helvetica', 'normal');
  doc.setTextColor(0, 0, 0);
  
  doc.setFont('helvetica', 'bold');
  doc.text('NOME:', 15, yPosition);
  doc.setFont('helvetica', 'normal');
  doc.text(data.customerName || '___________________________________', 32, yPosition);
  
  doc.setFont('helvetica', 'bold');
  doc.text('CNPJ/CPF:', pageWidth / 2 + 5, yPosition);
  doc.setFont('helvetica', 'normal');
  doc.text(data.customerDoc || '_______________________', pageWidth / 2 + 25, yPosition);
  
  yPosition += 6;
  
  doc.setFont('helvetica', 'bold');
  doc.text('ENDEREÇO:', 15, yPosition);
  doc.setFont('helvetica', 'normal');
  const addressText = data.customerAddress || '___________________________________';
  const maxAddressWidth = pageWidth - 50;
  const addressLines = doc.splitTextToSize(addressText, maxAddressWidth);
  doc.text(addressLines[0], 37, yPosition);
  
  yPosition += 6;
  
  doc.setFont('helvetica', 'bold');
  doc.text('TELEFONE:', 15, yPosition);
  doc.setFont('helvetica', 'normal');
  doc.text(data.customerPhone || '_______________________', 35, yPosition);
  
  yPosition += 12;

  // TABELA DE ITENS
  const tableData = data.items.map(item => [
    item.quantity.toString(),
    item.description,
    `R$ ${item.unitPrice.toFixed(2).replace('.', ',')}`,
    `R$ ${item.total.toFixed(2).replace('.', ',')}`
  ]);

  autoTable(doc, {
    startY: yPosition,
    head: [['QTDE', 'DESCRIÇÃO DO MATERIAL', 'VALOR UN.', 'VALOR TOTAL']],
    body: tableData,
    theme: 'grid',
    headStyles: {
      fillColor: [66, 66, 66],
      textColor: [255, 255, 255],
      fontStyle: 'bold',
      fontSize: 9,
      halign: 'center'
    },
    columnStyles: {
      0: { halign: 'center', cellWidth: 20 },
      1: { halign: 'left', cellWidth: 'auto' },
      2: { halign: 'right', cellWidth: 30 },
      3: { halign: 'right', cellWidth: 35 }
    },
    bodyStyles: {
      fontSize: 8,
      textColor: [0, 0, 0]
    },
    alternateRowStyles: {
      fillColor: [245, 245, 245]
    },
    margin: { left: 10, right: 10 }
  });

  yPosition = (doc as any).lastAutoTable.finalY + 5;

  // TOTAIS E OBSERVAÇÕES
  // DEPOIS (CORRETO):
const subtotal = data.items.reduce((sum, item) => sum + item.total, 0);

// ✅ Calcula desconto baseado no tipo
const discount = data.discountType === 'percent' 
  ? subtotal * (data.discountAmount / 100)  // Se for %, calcula percentual
  : data.discountAmount;                     // Se for valor fixo, usa direto

const total = subtotal - discount;

  const obsWidth = 105;
  const totalsWidth = 70;
  const boxHeight = discount > 0 ? 30 : 24;
  
  const obsX = 10;
  const totalsX = pageWidth - totalsWidth - 10;

  if (data.observations) {
    doc.setFillColor(254, 243, 199);
    doc.rect(obsX, yPosition, obsWidth, boxHeight, 'F');
    doc.setDrawColor(200, 200, 200);
    doc.rect(obsX, yPosition, obsWidth, boxHeight);
    
    doc.setFontSize(9);
    doc.setFont('helvetica', 'bold');
    doc.setTextColor(0, 0, 0);
    doc.text('OBSERVAÇÕES:', obsX + 5, yPosition + 6);
    
    doc.setFont('helvetica', 'normal');
    doc.setFontSize(8);
    const obsLines = doc.splitTextToSize(data.observations, obsWidth - 10);
    doc.text(obsLines, obsX + 5, yPosition + 12);
  }

  doc.setDrawColor(200, 200, 200);
  doc.rect(totalsX, yPosition, totalsWidth, boxHeight);
  
  doc.setFontSize(9);
  doc.setFont('helvetica', 'normal');
  doc.setTextColor(0, 0, 0);
  
  let currentY = yPosition + 6;
  
  doc.text('Subtotal:', totalsX + 5, currentY);
  doc.text(`R$ ${subtotal.toFixed(2).replace('.', ',')}`, pageWidth - 15, currentY, { align: 'right' });
  
  if (discount > 0) {
    currentY += 6;
    doc.setTextColor(220, 53, 69);
    doc.text('Desconto:', totalsX + 5, currentY);
    doc.text(`- R$ ${discount.toFixed(2).replace('.', ',')}`, pageWidth - 15, currentY, { align: 'right' });
    doc.setTextColor(0, 0, 0);
  }
  
  currentY += 2;
  doc.setDrawColor(0, 0, 0);
  doc.line(totalsX, currentY, pageWidth - 10, currentY);
  
  currentY += 6;
  doc.setFontSize(11);
  doc.setFont('helvetica', 'bold');
  
  const totalLabel = data.paymentMethod ? data.paymentMethod.substring(0, 20).toUpperCase() + ':' : 'TOTAL:';
  doc.text(totalLabel, totalsX + 5, currentY);
  doc.text(`R$ ${total.toFixed(2).replace('.', ',')}`, pageWidth - 15, currentY, { align: 'right' });
  
  yPosition += boxHeight + 10;

  // ASSINATURA
  if (data.customerSignature) {
    doc.setFontSize(8);
    doc.setFont('helvetica', 'normal');
    doc.text('_________________________________________', pageWidth / 2, yPosition, { align: 'center' });
    doc.setFont('helvetica', 'bold');
    doc.text(data.customerSignature, pageWidth / 2, yPosition + 5, { align: 'center' });
    doc.setFont('helvetica', 'normal');
    doc.text('Assinatura do Cliente', pageWidth / 2, yPosition + 10, { align: 'center' });
    
    yPosition += 20;
  }

  // GARANTIA
  if (yPosition > pageHeight - 30) {
    doc.addPage();
    yPosition = 20;
  }

  doc.setFillColor(254, 226, 226);
  doc.rect(10, yPosition, pageWidth - 20, 20, 'F');
  doc.setDrawColor(220, 53, 69);
  doc.rect(10, yPosition, pageWidth - 20, 20);
  
  doc.setFontSize(7);
  doc.setFont('helvetica', 'normal');
  doc.setTextColor(153, 27, 27);
  
  const garantiaText = [
    'PREZADO CLIENTE, AO RECEBER SEU MATERIAL FAVOR CONFERIR, POIS APÓS A ENTREGA',
    'NÃO NOS RESPONSABILIZAMOS POR DIVERGÊNCIA APÓS'
  ];
  
  doc.text(garantiaText, pageWidth / 2, yPosition + 6, { align: 'center' });
  
  doc.setFont('helvetica', 'bold');
  const garantiaTextBold = 'MATERIAL EM LED COM 6 MESES DE GARANTIA, SOMENTE SERÁ VÁLIDA COM A APRESENTAÇÃO DESTA NOTINHA.';
  const garantiaLines = doc.splitTextToSize(garantiaTextBold, pageWidth - 30);
  doc.text(garantiaLines, pageWidth / 2, yPosition + 13, { align: 'center' });

  const fileName = `Orcamento_${data.quoteNumber}_${data.customerName.replace(/\s/g, '_') || 'Cliente'}.pdf`;
  doc.save(fileName);
  
  return fileName;
};

export const generateQuotePDFBlob = (data: QuoteData): Blob => {
  const doc = new jsPDF();
  return doc.output('blob');
};